import React from "react";
import MainNav from "../ComponentsMainPage/mainNav";
import MainPageOne from "../ComponentsMainPage/mainPageOne";
import MainPageAdvert from "../ComponentsMainPage/mainPageAdvert";
import MainPageQuestion from "../ComponentsMainPage/mainPageQuestion";
import BestOffers from "../ComponentsMainPage/bestOffers";
import Footer from "../ComponentsMainPage/footer";

function MainPage(){
    return(
        <div>
            <MainNav/>
            <MainPageOne/>
            <MainPageAdvert/>
            <MainPageQuestion/>
            <BestOffers/>
            <Footer/>
        </div>
    )
}
export default MainPage;
